// Tab.tsx
import CustomButton from '../../atoms/Button'; // 버튼 컴포넌트를 호출할 때 alias로 변경

const Tab: React.FC<TabWrapperProps> = ({
  id,
  category,
  onClickCategory,
  active,
  ...props
}) => {
  return (
    <div className='TabWrapper'>
      <CustomButton
        data-id={id}
        style={{
          backgroundColor: 'white',
          height: '80px',
          minWidth: '240px',
        }}
        onClick={onClickCategory}
        {...props}
      >
        {category} 
      </CustomButton>
    </div>
  );
};

export default Tab;
